INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENVB', 'STOCK', 'Enveric Biosciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Enveric Biosciences, Inc. is a biotechnology company. The Company is engaged in the development of neuroplastogenic small-molecule therapeutics for the treatment of depression, anxiety, and addiction disorders. Leveraging its discovery and development platform, the Psybrary platform, which houses proprietary information on the use and development of existing and novel molecules for specific mental health indications, the Company seeks to develop a robust intellectual property portfolio of drug candidates. Its lead molecule, EB-003, is a neuroplastogen designed to promote neuroplasticity, without inducing hallucinations, in patients suffering from difficult-to-address mental health disorders. The Company is focused on advancing EB-003 towards clinical trials for the treatment of neuropsychiatric disorders while out-licensing other Psybrary platform drug candidates to third-party licensees and advancing non-competitive market strategies for patient care.', 'Naples, FL, United States', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAMI', 'STOCK', 'Acadian Asset Management Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Acadian Asset Management Inc., formerly Brightsphere Investment Group Inc., is a holding company of Acadian Asset Management LLC with approximately $120 billion of assets under management. The Company offers institutional investors across the globe access to a diversified array of systematic investment strategies designed to meet a range of risk and return objectives. Acadian Asset Management LLC is a global, quantitative, investment manager. Acadian Asset Management LLC manages both equity strategies intended to deliver active returns and alternative strategies designed to deliver absolute, uncorrelated returns. Its sustainable investing capabilities are integrated throughout all strategies and provide a platform for both client-specific solutions and engagement.', 'Boston, MA, United States', 383);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CW', 'STOCK', 'Curtiss-Wright Corporation', 'NYQ', 'Industrials', 'Aerospace & Defense', 'Curtiss-Wright Corporation is a global integrated business that provides engineered products, solutions, and services mainly to the Aerospace & Defense markets, as well as critical technologies in demanding commercial power, process, and industrial markets. The Company''s segments include Aerospace & Industrial, Defense Electronics, and Naval & Power. The Aerospace & Industrial segment consists of businesses that provide a diversified offering of engineered products and services supporting applications primarily across the commercial aerospace and general industrial markets. The Defense Electronics segment comprises businesses that primarily provide products for the defense market and, to a lesser extent, the commercial aerospace market. The Naval & Power segment comprises businesses that provide products for naval defense and, to a lesser extent, the power and process and aerospace defense markets. The products offered include main coolant pumps, seals, valves, and others.', 'Davidson, NC, United States', 9000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMZE', 'STOCK', 'Amaze Holdings, Inc.', 'ASE', 'Consumer Defensive', 'Beverages - Wineries & Distilleries', 'Amaze Holdings, Inc., formerly Fresh Vine Wine, Inc., is an end-to-end, creator-powered commerce platform offering tools for product creation, advanced e-commerce solutions, and scalable managed services. It enables creators to tell their stories, cultivate audience connections, and generate sustainable income through shoppable experiences. It operates Teespring Marketplace (Teespring), which leverages AI-powered curation and sales data to highlight trending, high-performing designs. Additionally, by prioritizing newly launched products, Teespring Marketplace keeps its selection timely, exclusive, and aligned with the latest cultural moments. In addition to AI-driven curation, Teespring offers Creator Spotlight, a feature that showcases both top-performing and emerging creators, giving them increased exposure and engagement opportunities. Teespring provides a range of custom creator-branded products, such as apparel, homeware, accessories, plushies, collectibles and other products.', 'Newport Beach, CA, United States', 4);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLRB', 'STOCK', 'Cellectar Biosciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cellectar Biosciences, Inc. is a late-stage clinical biopharmaceutical company. The Company is focused on the discovery, development, and commercialization of drugs for treatment of cancer. The Company, through its phospholipid ether drug conjugate (PDC) delivery platform, is focused on developing PDCs that are designed to specifically target cancer cells. Its PDC platform possesses the potential for the discovery and development of cancer-targeting treatments, and it plans to develop PDCs both independently and through research and development collaborations. Its lead programs are: Iopofosine I 131 (iopofosine), a beta-emitting iodine-131-based program which has been studied extensively; CLR 121225, an actinium-225-based program; and CLR 121125, an iodine-125 Auger-emitting program. Iopofosine evaluation is ongoing in a Phase IIb study in r/r multiple myeloma and central nervous system lymphoma patients and the CLOVER-2 Phase Ib study for pediatric patients with high grade gliomas.', 'Florham Park, NJ, United States', 11);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIMD', 'STOCK', 'Ainos, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Ainos, Inc. is a dual-platform AI and biotech company advancing SmellTech and immune therapeutics. Its AI Nose platform and smell language model (SML) digitize scent into Smell ID, a machine-readable data, powering applications across robotics, smart factories, and healthcare. It is also developing VELDONA, an oral low-dose interferon therapy targeting rare diseases, autoimmune diseases, infectious diseases, and animal health. Its pipeline includes drug candidates for treating oral warts for human immunodeficiency virus seropositive patients, Sjogrens syndrome, and feline chronic gingivostomatitis, a cat oral infection. Its product pipeline includes VELDONA Pet, VELDONA human drugs, AI Nose - NISD co-development, AI Nose industrial and robotics application, VOC POCT, VOC POCT Ainos Pen, VOC POCT CHS430, and Synthetic RNA (SRNA). VOC POCT-Ainos Pen is a device intended to be a cloud-connected, multipurpose, portable breath analyzer that is intended to monitor health conditions.', 'San Diego, CA, United States', 44);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOC', 'STOCK', 'Boston Omaha Corporation', 'NYQ', 'Industrials', 'Conglomerates', 'Boston Omaha Corporation is engaged in outdoor billboard advertising, broadband services, surety insurance and related brokerage activities, and an asset management business. The Companys segments include General Indemnity Group, LLC (GIG), Link Media Holdings, LLC (LMH), Boston Omaha Broadband, LLC (BOB) and Boston Omaha Asset Management, LLC (BOAM). GIG segment, through its subsidiaries, is engaged in the insurance business. The LMH segment conducts its billboard rental operations. LMH billboards are located in Alabama, Arkansas, Florida, Georgia, Illinois, Iowa, Kansas, Missouri, Nebraska, Nevada, Oklahoma, South Dakota, Tennessee, Virginia, West Virginia and Wisconsin. BOB segment conducts its broadband operations. BOB provides high-speed broadband services to its customers located in Arizona, Florida, Nevada, and Utah. BOAM segment conducts its asset management operations. It also holds minority investments in commercial real estate management and brokerage services.', 'Omaha, NE, United States', 407);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAIO', 'STOCK', 'Data I/O Corporation', 'NCM', 'Technology', 'Electronic Components', 'Data I/O Corporation provides advanced programming, security deployment, security provisioning and associated Intellectual Property protection and management solutions. Its solutions are used in electronics manufacturing with flash memory, microcontrollers, flash memory-based intelligent devices, and secure element devices, authentication devices and secure microcontrollers. It designs, manufactures and sells programming and security deployment systems and services for electronic device manufacturers, specifically targeting high-growth areas, such as high-volume users of flash memory and flash memory-based microcontrollers. Its programming solutions include a range of products, systems, modules and accessories, grouped into two general categories: automated programming systems and manual programming systems. Its products include PSV Systems: Off-line (Automated); SentriX Security Deployment System; LumenX Programmer (Non-automated), and FlashPAK III programmer: (non-automated).', 'Redmond, WA, United States', 88);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BY', 'STOCK', 'Byline Bancorp, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Byline Bancorp, Inc. is a bank holding company. The Company conducts all its business activities through its subsidiary, Byline Bank, a full-service commercial bank, and Byline Banks subsidiaries. It offers a range of banking products and services to small and medium-sized businesses, commercial real estate and financial sponsors and to consumers who generally live or work near its branches. It also offers online account opening to consumer and business customers through its Website and provides trust and wealth management services to its customers. In addition to its traditional commercial banking business, it provides small ticket equipment leasing solutions through Byline Financial Group, a wholly owned subsidiary of Byline Bank. It offers a range of commercial loan, deposit and treasury management products. Its primary commercial lending groups include commercial and industrial, commercial real estate, sponsor finance, commercial deposits and treasury management and others.', 'Chicago, IL, United States', 1017);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGO', 'STOCK', 'Assured Guaranty Ltd.', 'NYQ', 'Financial Services', 'Insurance - Specialty', 'Assured Guaranty Ltd. is a Bermuda-based holding company. Through its subsidiaries, the Company provides credit enhancement products to the United States and non-United States public finance, infrastructure and structured finance markets. The Company also participates in the asset management business through its ownership interest in Sound Point Capital Management, LP and certain of its investment management affiliates. Its segments include Insurance and Asset Management. Through its insurance subsidiaries, the Company applies its credit underwriting judgment, risk management skills and capital markets experience primarily to offer financial guaranty insurance that protects holders of debt instruments and other monetary obligations from defaults in scheduled payments. Asset management segment serves as an investment advisor to primarily collateralized loan obligations and opportunity funds, through Assured Investment Management LLC and its investment management affiliates.', 'Hamilton, , Bermuda', 361);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CEPI', 'STOCK', 'REX Crypto Equity Premium Income ETF', 'NGM', NULL, NULL, 'The fund, under normal market conditions, invests at least 80% of its net assets (plus any borrowings for investment purposes) in equity securities of companies comprising the BITA Crypto Assets & Digital Payments Index. The index is a rules-based composite index that tracks the market performance of 25 companies, listed on regulated exchanges based in the U.S., that are actively engaged in crypto-related activities. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASRT', 'STOCK', 'Assertio Holdings, Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Assertio Holdings, Inc. is a pharmaceutical company offering differentiated products to patients. The Company has built its commercial portfolio through the acquisition or licensing of approved products. Its commercial capabilities include marketing through both a sales force and an omni-channel promotion model, market access through payor contracting, and trade and distribution. The Companys primary marketed products include ROLVEDONTM (eflapegrastim-xnst) injection for subcutaneous use, INDOCIN (indomethacin) Suppositories, INDOCIN (indomethacin) Oral Suspension, Sympazan (clobazam) oral film, Otrexup (methotrexate) injection for subcutaneous use, SPRIX (ketorolac tromethamine) Nasal Spray, and CAMBIA (diclofenac potassium for oral solution). INDOCIN (indomethacin) Suppositories and INDOCIN (indomethacin) Oral Suspension products are nonsteroidal anti-inflammatory drugs (NSAID). Otrexup is a once weekly single-dose auto-injector containing methotrexate.', 'Lake Forest, IL, United States', 58);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CASI', 'STOCK', 'CASI Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'CASI Pharmaceuticals, Inc. is a biopharmaceutical company. The Company is focused on developing and commercializing therapeutics and pharmaceutical products in China, the United States, and throughout the world. The Company is focused on acquiring, developing, and commercializing products that augment its hematology oncology therapeutic focus as well as other areas of unmet medical need. Its commercial product, EVOMELA, is an intravenous formulation of melphalan commercialized by Acrotech in the multiple myeloma treatment setting in the United States. Its pipeline products include CNCT19 (CD19 CAR-T), BI-1206 (anti- FcYRIIB antibody), CB-5339 (VCP/p97 inhibitor), CID-103 (Anti-CD38 Mab), Thiotepa, and Octreotide LAI. The Companys Food and Drug Administration (FDA)-approved generic products for the China market include Entecavir tablets, Tenofovir disoproxil fumarate (TDF) tablets, Cilostazol tablets-50mg, Cilostazol tablets-100mg, Ondansetron HCL tablets, and Tizanidine tablets.', 'Beijing, , China', 233);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DXF', 'STOCK', 'Eason Technology Limited', 'ASE', 'Financial Services', 'Credit Services', 'Eason Technology Ltd, formerly Dunxin Financial Holdings Ltd, is an investment holding company primarily engaged in the real estate operation management and investment business as well as digital security technology business. The real estate operation management and investment business mainly engages in providing comprehensive management consulting services to property owners and businesses as well as providing entrusted management services. The digital security technology business mainly engages in providing digital security solutions to enterprises (To B) to help protect their critical data and information assets as well as providing digital security hardware products to consumers (To C).', 'Wuhan, , China', 10);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLDT', 'STOCK', 'Chatham Lodging Trust', 'NYQ', 'Real Estate', 'REIT - Hotel & Motel', 'Chatham Lodging Trust is a real estate investment trust (REIT), which is focused primarily on investing in upscale extended-stay hotels and premium-branded select-service hotels. Substantially all of the Company''s assets are held by, and all of its operations are conducted through Chatham Lodging, L.P. (the Operating Partnership). The Company owns approximately 36 hotels totaling 5,475 rooms/suites in 15 states and the District of Columbia. Its hotels include upscale extended-stay hotels that operate under the Residence Inn by Marriott, the Homewood Suites by Hilton, the Home2 Suites by Hilton and the TownePlace Suites by Marriott, as well as premium-branded select-service hotels that operate under the Courtyard by Marriott brand, the Hampton Inn or Hampton Inn and Suites by Hilton, the Hilton Garden Inn by Hilton, the SpringHill Suites by Marriott, the Hyatt Place, and all-suite hotels that operate under the upper upscale Embassy Suites.', 'West Palm Beach, FL, United States', 17);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DYAI', 'STOCK', 'Dyadic International, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dyadic International, Inc. is a biotechnology company focused on the large-scale manufacture of proteins for use in human and animal vaccines and therapeutics and for use in non-pharmaceutical applications including food, nutrition, and wellness. The Company''s gene expression and protein production platforms are based on the highly productive and scalable fungus Thermothelomyces heterothallica, which the Company named C1. The Compnys lead technology, C1-cell protein production platform, is based on an industrially proven microorganism (named C1), which is used to speed development and improve performance of biologic vaccines and drugs at flexible commercial scales for the human and animal health markets. The Company has also developed the Dapibus filamentous fungal based microbial protein production platform to enable the rapid development and large-scale manufacture of low-cost proteins, metabolites, and other biologic products for use in non-pharmaceutical applications.', 'Jupiter, FL, United States', 6);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIK', 'STOCK', 'Credit Suisse Asset Management Income Fund, Inc.', 'ASE', 'Financial Services', 'Asset Management', 'Credit Suisse Asset Management Income Fund, Inc. is a closed-ended fixed income mutual fund launched and managed by Credit Suisse Asset Management, LLC. The fund invests in the fixed income markets of the United States. It primarily invests in high yield corporate debt such as bonds and debentures that are rated Baa or lower by Moody''s or BBB or lower by S&P. The fund benchmarks the performance of its portfolio against the BofA Merrill Lynch US High Yield Master II Constrained Index. Credit Suisse Asset Management Income Fund, Inc. was formed on February 11, 1987 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTZ', 'STOCK', 'BlackRock Credit Allocation Income Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Credit Allocation Income Trust is a closed ended balanced mutual fund launched by BlackRock, Inc. The fund is co-managed by BlackRock Advisors, LLC and BlackRock (Singapore) Limited. It invests in the fixed income markets across the globe. For the fixed income portion of the portfolio, the fund primarily invests in securities with an average credit quality of BBB by Standard & Poor''s Corporation. It invests in investment grade corporate bonds, high yield bonds, bank loans, preferred securities or convertible bonds or derivatives. The fund was formerly known as BlackRock Preferred & Equity Advantage Trust. BlackRock Credit Allocation Income Trust was formed on December 27, 2006 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AWF', 'STOCK', 'AllianceBernstein Global High Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'AllianceBernstein Global High Income Fund is a close-ended fixed income mutual fund launched and managed by AllianceBernstein L.P. It invests in fixed income markets across the globe. The fund primarily invests in lower-rated corporate debt securities and government bonds. It employs a combination of fundamental and quantitative analysis to create its portfolio. The fund benchmarks the performance of its portfolio against a composite index comprised of JPMorgan Government Bond Index-Emerging Markets, JPMorgan Emerging Markets Bond Index Global, and the Barclays U.S. Corporate High Yield 2% Issuer Capped Index. It was previously known as Alliance World Dollar Government Fund II, Inc. AllianceBernstein Global High Income Fund was formed on May 20, 1993 and is domiciled in the United States.', 'Nashville, TN, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMRK', 'STOCK', 'A-Mark Precious Metals, Inc.', 'NMS', 'Financial Services', 'Capital Markets', 'A-Mark Precious Metals, Inc. provides a fully integrated precious metals platform. It offers an array of gold, silver, platinum, palladium, and copper bullion, numismatic coins, and related products to wholesale and retail customers via a portfolio of channels. Its Wholesale Sales & Ancillary Services segment distributes and purchases precious metal products from sovereign and private mints. Its Direct-to-Consumer segment operates as an omni-channel retailer of precious metals, providing access to a multitude of products through its subsidiaries, JM Bullion, Inc. (JMB), Goldline, Inc., AMS Holding, LLC (AMS) and Silver Gold Bull, Inc. JMB owns and operates numerous websites targeting specific niches within the precious metals retail market, including JMBullion.com, ProvidentMetals.com, Silver.com, CyberMetals.com, and others. AMS operates GOVMINT, which markets vintage and modern coins. It operates its Secured Lending segment through its subsidiary, Collateral Finance Corporation, LLC.', 'El Segundo, CA, United States', 482);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBLG', 'STOCK', 'Bone Biologics Corporation', 'NCM', 'Healthcare', 'Medical Devices', 'Bone Biologics Corporation is a clinical-stage developer of orthobiologic products for spine fusion markets. The Company is focused on bone regeneration in lumbar spinal fusion using neural epidermal growth factor-like 1 protein (NELL-1) in combination with demineralized bone matrix (DBM), a demineralized bone matrix from the Musculoskeletal Transplant Foundation (MTF) Biologics. The combination NELL-1/DBM medical device is an osteopromotive recombinant protein that provides target specific control over bone regeneration. NELL-1 in combination with DBM. NELL-1, a proprietary skeletal-specific growth factor that is a bone void filler. NELL-1 provides regulation over skeletal tissue formation and stem cell differentiation during bone regeneration. The DBM Demineralized Bone Putty provided as part of the convenience kit with NELL-1/DBM is a Class II device. DBM Putty is a matrix composed of processed human cortical bone.', 'Burlington, MA, United States', 2);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOLD', 'STOCK', 'Boundless Bio, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Boundless Bio, Inc. is a clinical-stage oncology company, which is engaged in cancer therapeutics that address the unmet need in patients with oncogene amplified tumors by targeting extrachromosomal DNA (ecDNA). Using its proprietary Spyglass platform, it identifies targets essential for ecDNA functionality in oncogene amplified cancer cells, then designs and develops small molecule drugs called ecDNA-directed therapeutic candidates (ecDTx) to inhibit those targets. The Companys lead therapeutic candidate ecDTx, BBI-355, is an oral, selective inhibitor of checkpoint kinase 1 (CHK1), which manages ecDNA replication and transcription in cancer cells. BBI-355 demonstrated CHK1 inhibition and tumor regressions in oncogene amplified preclinical cancer models, including those enabled by ecDNA, and is being studied in a first-in-human, Phase I/II clinical trial in patients with oncogene amplified cancers. Its next program is directed at a previously undrugged kinesin target.', 'San Diego, CA, United States', 64);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOE', 'STOCK', 'BlackRock Enhanced Global Dividend Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Enhanced Global Dividend Trust is a closed ended equity mutual fund launched by BlackRock, Inc. The fund is co-managed by BlackRock Advisors, LLC and BlackRock International Limited. It invests in public equity markets across the globe. The fund seeks to invest in stocks of companies operating across diversified sectors. It invests in stocks of companies across all market capitalizations. The fund also invests through derivatives, with an emphasis on options on equity securities or indices. It benchmarks the performance of its portfolio against the S&P Global Broad Market Index. The fund was formerly known as BlackRock Global Opportunities Equity Trust. BlackRock Enhanced Global Dividend Trust was formed on May 31, 2005 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGICA', 'STOCK', 'Donegal Group Inc.', 'NMS', 'Financial Services', 'Insurance - Property & Casualty', 'Donegal Group Inc. (DGI) is an insurance holding company. The Company, through its insurance subsidiaries and affiliates, offers property and casualty lines of insurance in 21 Mid-Atlantic, Midwestern, Southern and Southwestern regions through approximately 2,100 independent insurance agencies. It operates through three segments: investment function, commercial lines of insurance and personal lines of insurance. The commercial lines products of its insurance subsidiaries consist primarily of commercial automobile, commercial multi-peril, and workers compensation policies. The personal lines products of insurance subsidiaries consist primarily of homeowners and private passenger automobile policies. The Companys insurance subsidiaries are Atlantic States Insurance Company (Atlantic States), Michigan Insurance Company (MICO), the Peninsula Insurance Group (Peninsula), and Southern Insurance Company of Virginia (Southern).', 'Marietta, PA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCSI', 'STOCK', 'Consensus Cloud Solutions, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Consensus Cloud Solutions, Inc. provides digital cloud fax technology. The Company offers secure information delivery services with a scalable software-as-a-service platform. It serves approximately 800 thousand customers of all sizes, from enterprises to individuals, across over 46 countries and multiple industry verticals, including healthcare, government, financial services, law and education. Its corporate solutions include eFax Corporate, ECFax, Unite, jSign, Conductor, and Clarity. Its SoHo Fax Solutions include eFax. Conductor is a robust interface engine and complete interoperability platform. jSign provides electronic signature and digital signature solutions to businesses, offering document markup and end-user signing services via mobile-aware Web applications and enterprise application programming interface (API). eFax is a global online faxing service with customers worldwide, it offers various brands for subscription including but not limited to MyFax, Sfax, and SRfax.', 'Los Angeles, CA, United States', 518);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDS', 'STOCK', 'Dillard''s, Inc.', 'NYQ', 'Consumer Cyclical', 'Department Stores', 'Dillard''s, Inc. is a retailer of fashion apparel, cosmetics and home furnishings. The Companys segments include the operation of retail department stores and a general contracting construction company. It operates 272 Dillards stores, including 28 clearance centers, and an Internet store at dillards.com offering a wide selection of merchandise including fashion apparel for women, men and children, accessories, cosmetics, home furnishings and other consumer goods. The Company also operates a general contracting construction company, CDI Contractors, LLC (CDI), a portion of whose business includes constructing and remodeling stores for the Company. Its merchandise selections include its lines of exclusive branded merchandise, such as Antonio Melani, Gianni Bini, GB, Roundtree & Yorke and Daniel Cremieux. Its retail stores are located primarily in shopping malls and open-air centers throughout the southwest, southeast and Midwest regions of the United States.', 'Little Rock, AR, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARTW', 'STOCK', 'Art''s-Way Manufacturing Co., Inc.', 'NCM', 'Industrials', 'Farm & Heavy Construction Machinery', 'Arts-Way Manufacturing Co., Inc. is a diversified, international manufacturer and distributor of equipment serving agricultural and research needs. The Company''s segments include Agricultural Products and Modular Buildings. The Agricultural Products segment manufactures a variety of specialized farm machinery under its own label, including portable and stationary animal feed processing equipment and related attachments used to mill and mix feed grains into custom animal feed rations; a line of forage equipment consisting of forage boxes, bale processors, running gear, and dump boxes; a line of manure spreaders; sugar beet harvesting equipment, and a line of dirt work equipment. The Modular Buildings segment is primarily engaged in the construction of modular laboratories and animal housing facilities through the Companys wholly owned subsidiary, Arts-Way Scientific, Inc. Buildings commonly produced range from basic swine buildings to complex containment research laboratories.', 'Armstrong, IA, United States', 89);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGII', 'STOCK', 'Digi International Inc.', 'NMS', 'Technology', 'Communication Equipment', 'Digi International Inc. is a global provider of Internet of Things (IoT) connectivity products, services, and solutions. The Company helps its customers deploy, monitor and manage critical communications infrastructures. Its segments include IoT Products and Services, and IoT Solutions. The IoT Products and Services segment offers products and services that help original equipment manufacturers as well as enterprise and government customers create and deploy secure IoT connectivity solutions. These include embedded and wireless modules, console servers, enterprise, and industrial routers as well as other infrastructure management equipment. The Company also provides its customers with a device management platform as well as other professional services. The IoT Solutions segment consists of SmartSense by Digi business and managed network-as-a-service business. It offers wireless temperature and other condition-based monitoring services as well as employee task management services.', 'Hopkins, MN, United States', 805);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHFAO', 'STOCK', 'Brighthouse Financial, Inc.', 'NMS', 'Financial Services', 'Insurance - Life', 'Brighthouse Financial, Inc. is a provider of annuities and life insurance in the United States. The Companys segments include Annuities; Life; Run-off, and Corporate & Other. The Annuities segment consists of a variety of variable, fixed, index-linked and income annuities designed to address contract holders needs for protected wealth accumulation on a tax-deferred basis, wealth transfer and income security. The Life segment consists of insurance products, including term, universal, whole and variable life products designed to address policyholders needs for financial security and protected wealth transfer, which may be on a tax-advantaged basis. The Run-off segment consists primarily of products that are no longer actively sold and are separately managed, including universal life with secondary guarantees, structured settlements, pension risk transfer contracts, certain Company-owned life insurance policies and certain funding agreements.', 'Charlotte, NC, United States', 1400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRBP', 'STOCK', 'Corbus Pharmaceuticals Holdings, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Corbus Pharmaceuticals Holdings, Inc. is an oncology and obesity company. The Company has a diversified portfolio and is committed to helping people defeat serious illness by bringing scientific approaches to well-understood biological pathways. The Companys oncology pipeline comprises two experimental drugs targeting solid tumors: CRB-701, an antibody drug conjugate (ADC) that targets the expression of Nectin-4 on cancer cells to release a cytotoxic payload, and CRB-601, an anti-integrin monoclonal antibody that blocks the activation of TGFB expressed on cancer cells. CRB-701 is a monoclonal antibody attached to a monomethyl auristatin E (MMAE) cytotoxic payload using a proprietary linker technology. The pipeline also includes CRB-913, a highly peripherally restricted cannabinoid type-1 (CB1) receptor inverse agonist for the treatment of obesity. CB1 inverse agonism is a clinically validated mechanism to induce weight loss.', 'Norwood, MA, United States', 28);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATPC', 'STOCK', 'Agape ATP Corporation', 'NCM', 'Consumer Defensive', 'Packaged Foods', 'Agape ATP Corporation is a Malaysia-based investment holding company. The principal activity of the Company is to supply health and wellness products, including supplements to assist in cell metabolism, detoxification, blood circulation, anti-aging, and products designed to improve the overall health system of the human body, along with various wellness programs. The Company offers three series of programs, each consisting of different services and products: ATP Zeta Health Program, ENERGETIQUE, and BEAUNIQUE. Its ATP Zeta Health Program is a health program designed to assist in the elimination of various diseases caused by environmental pollutants, unhealthy dietary intake, and unhealthy lifestyles. The ENERGETIQUE series consists of energy mask series, hyaluronic acid, and mousse facial cleanser. Its BEAUNIQUE product series focuses on researching diets impact on modifying gene expressions to address genetic variations and deliver a nutrigenomic solution for every individual.', 'Kuala Lumpur, , Malaysia', 16);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DY', 'STOCK', 'Dycom Industries, Inc.', 'NYQ', 'Industrials', 'Engineering & Construction', 'Dycom Industries, Inc. is a provider of specialty contracting services to the telecommunications infrastructure and utility industries throughout the United States. These services include program management, planning, engineering and design; aerial, underground, and wireless construction; maintenance; and fulfillment services for telecommunications providers. Additionally, it provides underground facility locating services for various utilities, including telecommunications providers, as well as other construction and maintenance services for electric and gas utilities. It supplies the expertise, labor, equipment, and tools necessary to provide services to its customers. The Company provides engineering services to telecommunications providers, including the planning and design of aerial, underground, and buried fiber optic, copper, and coaxial cable systems that extend from the telephone company hub location, or cable operator headend, to a consumers home or business.', 'Palm Beach Gardens, FL, United States', 15708);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANNA', 'STOCK', 'AleAnna, Inc.', 'NCM', 'Energy', 'Oil & Gas E&P', 'AleAnna, Inc. is a natural gas resource company. It is focused on delivering critical natural gas supplies to Europe through both onshore conventional natural gas exploration and renewable natural gas development in Italy. It has conventional natural gas discoveries, including its primary discovery, the Longanesi Field, located in the Po Valley in Northern Italy. It has a 33.5% working interest in the Longanesi field with its working interest partner, and operator, Padana, representing the other 66.5% working interest. Its portfolio is comprised of a group of three discoveries under development (Longanesi, Gradizza, and Trava), which are surrounded by an additional 13 development and exploration prospects (within the Longanesi and Ponte dei Grilli Clusters) that are at various stages of permitting and are supported by proprietary 3D seismic surveys. It is also involved in drilling, testing, and tie-in-related activities associated with three incremental Longanesi development wells.', 'Dallas, TX, United States', 7);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBLL', 'STOCK', 'CeriBell, Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'CeriBell, Inc. is a medical technology company focused on transforming the diagnosis and management of patients with serious neurological conditions. The Company has developed the Ceribell System, a point-of-care electroencephalography (EEG) platform specifically designed to address the unmet needs of patients in the acute care setting. By combining highly portable and rapidly deployable hardware with artificial intelligence-powered algorithms, the Ceribell System enables rapid diagnosis and continuous monitoring of patients with neurological conditions. The Ceribell System is FDA-cleared (510(k)) for indicating suspected seizure activity and utilized in intensive care units and emergency rooms across the United States. Clarity, its machine learning algorithm, continuously interprets a patients EEG waveforms and displays actionable insights regarding seizure activity on the recorder. Its EEG portal is a cloud-based portal that enables real-time remote access to a patients EEG data.', 'Sunnyvale, CA, United States', 281);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVCO', 'STOCK', 'Cavco Industries, Inc.', 'NMS', 'Consumer Cyclical', 'Residential Construction', 'Cavco Industries, Inc. is a producer of manufactured homes in the United States. The Company designs and produces factory-built homes primarily distributed through a network of independent and Company-owned retailers, planned community operators and residential developers. Its segments include Factory-built Housing and Financial Services. The Factory-built Housing segment includes wholesale and retail factory-built housing operations. The Financial Services segment includes manufactured housing consumer finance and insurance. Its products are marketed under a variety of brand names including Cavco, Fleetwood, Palm Harbor, Nationwide, Fairmont, Friendship, Chariot Eagle, Destiny, Commodore, Colony, Pennwest, R-Anell, Manorwood, MidCountry and Solitaire. The Company also produces park model recreational vehicles (RVs), vacation cabins and factory-built commercial structures. CountryPlace Acceptance Corp. is its finance subsidiary and Standard Casualty Co. is its insurance subsidiary.', 'Phoenix, AZ, United States', 7000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAPS', 'STOCK', 'Capstone Holding Corp.', 'NCM', 'Basic Materials', 'Building Materials', 'Capstone Holding Corp. is a building products distribution company. The Company operates through its subsidiary, TotalStone, LLC (TotalStone). TotalStone has a building products distribution network that services 31 U.S. states. TotalStone distributes masonry stone products for residential and commercial construction in the Midwest and Northeast United States under the trade names Instone and Northeast Masonry Distributors (NMD). Its products include stone veneer, landscape stone, and modular masonry fireplaces. Its brands include Cultured Stone, Dutch Quality, Isokern, Aura, Pangea Stone, Toro Stone, Beon Stone, and Interloc.', 'Alsip, IL, United States', 36);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BATRK', 'STOCK', 'Atlanta Braves Holdings, Inc.', 'NMS', 'Communication Services', 'Entertainment', 'A Liberty Media Corporation possui participações em subsidiárias e outras empresas envolvidas nos setores de mídia e entretenimento. Os principais negócios e ativos da Companhia incluem suas subsidiárias consolidadas Sirius XM Holdings Inc. (SIRIUS XM) e Braves Holdings, LLC (Braves Holdings) e sua afiliada de capital social Live Nation Entertainment, Inc. (Nação ao Vivo). Os segmentos da Companhia são SIRIUS XM, Corporate e outros. O SIRIUS XM fornece um serviço de rádio por satélite baseado em assinatura. Por meio de suas subsidiárias e afiliadas, a Companhia opera principalmente na América do Norte. A empresa também possui uma carteira de investimentos minoritários em empresas de mídia de capital aberto, como Time Warner, Inc. e Viacom, Inc. SIRIUS XM transmite canais de música, esportes, entretenimento, comédia, notícias, tráfego e meteorologia, bem como serviços de infoentretenimento, nos Estados Unidos, mediante assinatura por meio de dois sistemas de rádio via satélite.', 'Atlanta, GA, United States', 1450);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSTE', 'STOCK', 'Caesarstone Ltd.', 'NMS', 'Industrials', 'Building Products & Equipment', 'Caesarstone Ltd. is an Israel-based manufacturer of engineered quartz surfaces. The Company''s products consist of engineered quartz, which are installed as countertops in residential kitchens. Its products are primarily used as kitchen countertops in the renovation, remodeling, and residential construction end markets. The other applications of its products include vanity tops, wall panels, backsplashes, floor tiles, stairs, and other interior surfaces that are used in a range of residential and non-residential applications. Its product offerings include over four collections, such as Classico, Concetto, Motivo, and Supernatural, which are marketed as specialty product collections. It sells its products under the Caesarstone brand. Its designs range from fine-grained patterns to coarse-grained color blends with a variegated visual texture. It offers over 70 different colors, with four textures and three thicknesses available for each of the collection''s colors.', 'Menashe, , Israel', 1532);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEYE', 'STOCK', 'AudioEye, Inc.', 'NCM', 'Technology', 'Software - Application', 'AudioEye, Inc. is a digital accessibility platform company that delivers Website accessibility compliance at all price points to businesses of all sizes. It operates in one segment as a provider of patented, Internet content publication and distribution software and related services and enables the conversion of digital content into accessible formats and allows for real-time distribution to end users on any Internet-connected device. Its solutions are backed by machine-learning/artificial intelligence-driven technology that finds and fixes common accessibility errors. Its technology addresses a range of disabilities, including dyslexia, color blindness, epilepsy, and more. It offers additional solutions, such as periodic auditing, human assisted technological remediations, legal support services and other professional services. It also offers PDF remediation services and mobile application and audit reporting services to help its customers with their digital accessibility needs.', 'Tucson, AZ, United States', 117);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLPR', 'STOCK', 'Clipper Realty Inc.', 'NYQ', 'Real Estate', 'REIT - Residential', 'Clipper Realty Inc. is a self-administered and self-managed real estate company. The Company acquires, owns, manages, operates, and repositions multifamily residential and commercial properties in the New York metropolitan area, with a portfolio in Manhattan and Brooklyn. The Company operates through two segments: Residential Rental Properties and Commercial Rental Properties. The Commercial Rental Properties segment includes the 141 Livingston Street property and portions of the 250 Livingston Street, Tribeca House, Dean Street and Aspen properties. The Residential Rental Properties segment includes the Flatbush Gardens property, the Clover House property, the 1010 Pacific Street property and portions of the 250 Livingston Street, Tribeca House, Dean Street and Aspen properties. The Company consists of over 10 properties totaling approximately 3.4 million rentable square feet.', 'Brooklyn, NY, United States', 171);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSVO', 'STOCK', 'EA Bridgeway Omni Small-Cap Value ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing primarily in a broad and diverse group of small-cap stocks that the Sub-Adviser determines are value stocks. Under normal circumstances, the fund invests 80% of its net assets (plus borrowings for investment purposes) in equity or equity-related securities (“common stocks”) of small-cap companies at the time of purchase.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASGI', 'STOCK', 'Abrdn Global Infrastructure Income Fund', 'NYQ', 'Financial Services', 'Asset Management', NULL, 'Philadelphia, PA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCLD', 'STOCK', 'CareCloud, Inc.', 'NGM', 'Healthcare', 'Health Information Services', 'CareCloud, Inc. is a provider of technology-enabled services and generative artificial intelligence (AI) solutions that redefine the healthcare revenue cycle management process. It provides technology-enabled revenue cycle management and a full suite of proprietary cloud-based solutions to healthcare providers, from small practices to enterprise medical groups, hospitals, and health systems throughout the United States. Its Healthcare IT segment includes technology-assisted revenue cycle management, software-as-a-service solutions and professional and other services. Its Medical Practice Management segment includes the management of three medical practices. Its technology-enabled business solutions include Technology-enabled revenue cycle management, Cloud-based software, Digital health, and Healthcare IT professional services & staffing. Its revenue cycle management services, including end-to-end medical billing, eligibility, analytics, and related services.', 'Somerset, NJ, United States', 3650);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVD', 'STOCK', 'American Vanguard Corporation', 'NYQ', 'Basic Materials', 'Agricultural Inputs', 'American Vanguard Corporation is a diversified specialty and agriculture products company, which develops and markets products for crop protection and management, turf and ornamentals management, and public and animal health. It conducts its business through its operating subsidiaries, including AMVAC Chemical Corporation (AMVAC) for its domestic business and AMVAC Netherlands BV (AMVAC BV) for its international business. AMVAC is a manufacturer of chemical, biological and biorational products that develops and markets solutions for agricultural, commercial and consumer uses. It synthesizes and formulates chemicals and ferments and extracts microbial products for crops, turf, ornamental plants, and human and animal health protection. These products, which include insecticides, fungicides, and biorationals, are marketed in liquid, powder, and granular forms. AMVAC BV sells products both directly and through its network of subsidiaries in various international territories.', 'Newport Beach, CA, United States', 755);\n